import React from 'react';

const Login = (props) =>  {

const { email,
  setEmail,
  password,
  setPassword,
  handleLogin,
  handleSignup,
  hasAccount,
  setHasAccount,
  emailError,
  passwordError } = props;

  return(
    <section>
    <div>
        <label>UserName</label>
          <input type="text"
                  autoFocus
                  required
                  value={email}
                  onChange={(e) => setEmail(e.target.value)}
          />
     
    
    </div>
  </section>
      
    
  )
}


export default Login;
